import React from 'react';

const ImageSlider = ({ SliderData }) => {
  return (
    <div>
      <h2>Image Slider</h2>
      <div>
        console.log(id);
        {SliderData.map(slide => (
          <div key={slide.id}>
            <img src={slide.image} alt={slide.description} />
            <p>{slide.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ImageSlider;
